import React from "react";
import styled from "styled-components";
import "../Styles/admin.css";

function admin() {
  return (
    <>
      <div>
        <AdminOuterContainer>
          <EmailPassword>
            Username
            <input
              type="text"
              placeholder="Enter your Username"
              className="EmailContainer"
            />
            Passowrd
            <input
              type="password"
              placeholder="Enter your Password"
              className="EmailContainer"
            />
          </EmailPassword>
        </AdminOuterContainer>
      </div>
    </>
  );
}

export default admin;

const AdminOuterContainer = styled.div`
  background-color: red;
  display: flex;
  flex-direction: column;
  width: 30em;
  height: 20em;
  padding: 20px;
  top: 50%;
  left: 50%;
  margin-left: -15em;
  margin-top: -9em;
  position: fixed;
  border-radius: 20px;
`;

const EmailPassword = styled.div`
  height: 15em;
  display: flex;
  flex-direction: column;
  padding: 10px;
  background-color: gray;
  width: 20em;
  top: 35.5%;
  left: 39%;
  position: fixed;
  align-items: center;
`;
